import SystemAppHeader from "../../../../Components/SystemAppHeader.vue";
export default {
  data() {
    return {
      wallpapers: [{
        name: "default",
        src: "default"
      }]
    };
  },
  components: {
    SystemAppHeader
  },
  computed: {
    wallpaper() {
      return this.$store.getters["phone/getWallpaper"];
    },
    wallpaperStyle() {
      if (this.wallpaper == "default") {
        return `url(${require(`@/Application/Pages/Phone/Assets/Screen-saver.png`)}) no-repeat center/cover`;
      }
      return `url(${this.wallpaper}) no-repeat center/cover`;
    }
  },
  methods: {
    goToInput() {
      this.$router.push("SettingsAppWallpapersInput");
    }
  }
};
